import TestPage from './TestPage'
import { Route, Routes } from 'react-router-dom'

export function RoutesElement(
  props: {}) {
  return (
  <Routes>
    <Route path="/">
      <Route path="test" element={<TestPage/>} />
    </Route>
  </Routes>
  )
}
